import React from 'react';
import ReactDOM from 'react-dom';
import App from 'App';
import Header from 'Header';
import Restaurants from 'Restaurants';
import TaskItem from 'TaskItem';

ReactDOM.render(
<App />, 
<Header />,
<Restaurants />,
<TaskItem />,
    document.getElementById('root')
    );
